script: |
  super -f text -I q4588.spq | sort > q4588.out

inputs:
  - name: q4588.spq
    data: |
      SELECT DISTINCT - col2 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT BETWEEN + col0 - - col2 + - 48 AND - - col0 - + + 11;
  - name: tab1

outputs:
  - name: q4588.out
    data: |
